import { makeStyles } from '@material-ui/core';
import React from 'react';
import Navegation from './Navegation';
import Return from './Return';
import perfil from './../images/perfil.jpg';
import ListName from './ListName';
import './../css/fonts.css';

const useStyles = makeStyles(()=>({
    dataContainer:{
        background:'red',
        margin:'80px 0 0  85px ',
        width:'100%',
        display:'flex',
        flexDirection:'column'
    },
    titleElection:{
        margin:'20px 0 0',
        textAlign:'center',
        fontSize:'40px',
        fontFamily: 'Rubik, sans-serif',
        fontWeight:'bold'
    },
    dataMember:{
        width:'70%',
        background:'green',
        margin:'20px auto 0',
        border:'1px solid #5A2120',
        display:'flex',
        flexDirection:'column'
    },
    headerData:{
        display:'flex',
        justifyContent:'space-between',
        width:'98%',
        margin:'10px auto',
        paddingBottom:'5px',
        borderBottom:'2px solid #FFEFC9'
    },
    imgCont:{
        width:'90px',
        "& img":{
            width:'100%'
        }
    },
    generalData:{
        width:'98%',
        margin:'10px auto',
        display:'flex',
        justifyContent:'left',
        "& div":{
            color:'#5A2120',
            borderBottom:'2px solid #5A2120',
            margin:'10px 0 5px'
        }
    },
    infoMember:{
        width:'98%',
        height:'100px',
        margin:'0 auto',
        background:'blue'
    }
}));

const Member = () => {
  const classes = useStyles();
  return (
      <React.Fragment>
        <Navegation />
        <div className={classes.dataContainer}>
            <div className={classes.titleElection}>ELECCIONES RECTORALES 2021</div>

            <div className={classes.dataMember}>
                <div className={classes.headerData}>
                    <div className={classes.imgCont}><img src={perfil}/></div>
                    <ListName />
                </div>
                <div className={classes.generalData}><div>DATOS GENERALES</div></div>

                <div className={classes.infoMember}>
                    <div className={classes.row}>
                        <div className={classes.fullName}></div>
                        <div className={classes.gender}></div>
                    </div>
                    <div className={classes.row}>
                        <div className={classes.fullName}></div>
                        <div className={classes.codeMember}></div>
                        <div className={classes.professionMember}></div>
                        <div className={classes.conditionMember}></div>
                    </div>
                </div>


            </div>
            
            <div className={classes.returnCont}><Return /></div>
        </div>
      </React.Fragment>
    
  );
}

export default Member;
